import React from 'react';
import { motion } from 'framer-motion';

const InteractiveLines: React.FC = () => {
  return (
    <div className="absolute inset-0 overflow-hidden">
      <motion.div
        className="absolute top-0 left-0 w-full h-full"
        initial={{ opacity: 0 }}
        animate={{ opacity: 1 }}
        transition={{ duration: 1 }}
      >
        {/* Horizontal Lines */}
        <motion.div
          className="absolute top-1/6 left-0 w-full h-0.5 bg-black"
          initial={{ scaleX: 0 }}
          animate={{ scaleX: 1 }}
          transition={{ duration: 1, delay: 0.3 }}
        />
        <motion.div
          className="absolute top-1/3 left-0 w-full h-0.5 bg-black"
          initial={{ scaleX: 0 }}
          animate={{ scaleX: 1 }}
          transition={{ duration: 1, delay: 0.5 }}
        />
        <motion.div
          className="absolute top-1/2 left-0 w-full h-0.5 bg-black"
          initial={{ scaleX: 0 }}
          animate={{ scaleX: 1 }}
          transition={{ duration: 1, delay: 0.7 }}
        />
        <motion.div
          className="absolute top-2/3 left-0 w-full h-0.5 bg-black"
          initial={{ scaleX: 0 }}
          animate={{ scaleX: 1 }}
          transition={{ duration: 1, delay: 0.9 }}
        />
        <motion.div
          className="absolute top-5/6 left-0 w-full h-0.5 bg-black"
          initial={{ scaleX: 0 }}
          animate={{ scaleX: 1 }}
          transition={{ duration: 1, delay: 1.1 }}
        />

        {/* Vertical Lines */}
        <motion.div
          className="absolute top-0 left-1/4 w-0.5 h-full bg-black"
          initial={{ scaleY: 0 }}
          animate={{ scaleY: 1 }}
          transition={{ duration: 1, delay: 0.4 }}
        />
        <motion.div
          className="absolute top-0 left-1/2 w-0.5 h-full bg-black"
          initial={{ scaleY: 0 }}
          animate={{ scaleY: 1 }}
          transition={{ duration: 1, delay: 0.6 }}
        />
        <motion.div
          className="absolute top-0 left-3/4 w-0.5 h-full bg-black"
          initial={{ scaleY: 0 }}
          animate={{ scaleY: 1 }}
          transition={{ duration: 1, delay: 0.8 }}
        />
      </motion.div>
    </div>
  );
};

export default InteractiveLines;
